var title_f23_0_23553="MVG calculation";
var content_f23_0_23553=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F79915&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F79915&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 471px\">",
"   <div class=\"ttl\">",
"    Calculation of the myocardial velocity gradient",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 451px; height: 284px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The peak negative myocardial velocity gradient (MVG) is obtained from tissue Doppler imaging (TDI). The endocardial and epicardial boundaries of the left ventricular (LV) posterior wall are manually traced from an M-mode image and the velocity between the two lines are extracted from the corresponding color-coded image (left panel). At each point in time, indicated by the vertical line in early diastole, the velocity profile across the myocardial wall is obtained and provided for the least squares linear regression analysis (right panel). The slope of the regression line was determined as the instaneous MVG; the MVG calculations are repeated at each point in time throughout the cardiac cycle and peak negative MVG is determined.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Shimizu, Y, Uematsu, M, Shimizu, H, et al, J Am Coll Cardiol 1998; 32:1418.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
