var title_f23_0_23558="Uterine descent";
var content_f23_0_23558=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67287&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67287&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 512px\">",
"   <div class=\"ttl\">",
"    Uterine prolapse",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 492px; height: 410px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Prolapse of the Uterus Prolapse of the uterus results from weakness of the supporting structures of the pelvic floor, and is often associated with a cystocele and rectocele. In progressive stages, the uterus becomes retroverted and descends down the vaginal canal to the outside. In first-degree prolapse, the cervix is still well within the vagina. In second-degree prolapse, it is at the introitus. In third-degree prolapse (procidentia), the cervix and vagina are outside the introitus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Bickley, LS, Szilagyi, P. Bates' Guide to Physical Examination and History Taking, Eighth Edition. Philadelphia: Lippincott Williams &amp; Wilkins 2003. Copyright &copy; 2003 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
