" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Congenital cytogenetic abnormalities",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?23/0/23562/contributors\">",
