"       <td class=\"sublist1\">",
"        Insulin resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hypertriglyceridemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
